	add("korephile", "{\"term\":\"korephile\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From the Ancient greek (to 1453) {{compound|κόρη|φιλέω|alt2\u003d-φῐ́λης|t1\u003dgirl|t2\u003d-lover|lang\u003dgrc|nocat\u003dyes}}, coined after {{m|en|korephilia}} and by analogy with {{m|en|paedophile}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A or older who is attracted toward young ( and/or ) ; a\", \"priority\":1}]}, \"synonyms\":{}}");

	add("korephilia", "{\"term\":\"korephilia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From the Ancient greek (to 1453) {{compound|κόρη|φιλία|alt2\u003dφῐλῐ́ᾱ|t1\u003dgirl|t2\u003dlove|lang\u003dgrc|nocat\u003dyes}}, coined by analogy with {{m|en|paedophilia}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"attraction of a or older toward young ( and/or\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, Geoffrey Scott Puterbaugh (username), “[https://groups.google.com/d/msg/soc.motss/yqSBdZ07h9k/EKHncDmfjDcJ Morning Gays at the AHA]” in \u0026lt;tt\u0026gt;soc.motss\u0026lt;/tt\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It seems safe to assume that the panelists were referring to (pick your term) man–boy love, pederasty, ephebophilia. They may also have been referring to \u0027\u0027korephilia\u0027\u0027 (woman–girl) and (looking internationally) may have been referring to paedophilia, since Dutch reformers seem to have seized on this term to refer to all inter-generational sex\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, David T. Evans, \u0027[http://www.scribd.com/doc/193513091/Sexual-Citizenship-1993 Sexual Citizenship: The Material Construction of Sexualities]\u0027 (2004), chapter 8, page 220\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Paedophilia and \u0027\u0027korephilia\u0027\u0027, respectively adult male and female ‘sexual love directed towards children…in pre-puberty and early adolescence’ (PIE 1978), have been openly championed by various organisations in the recent past\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Ruediger Landmann (username), “[https://groups.google.com/d/msg/alt.config/NXmwAJnInoE/2VX8rQGtwp0J Re: Proposal: alt.binaries.korephile]” in \u0026lt;tt\u0026gt;alt.config\u0026lt;/tt\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"How many posts about \u0027\u0027korephilia\u0027\u0027 are being made to already existing newsgroups at the moment\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, James T. Sears (editor), \u0027The Greenwood Encyclopedia of Love, Courtship, \u0026amp; Sexuality Through History\u0027 VI: \u0027The Modern World\u0027, “[http://books.google.co.uk/books?id\u003dzFbAHCuBG5wC\u0026amp;q\u003d%22korephilia%22\u0026amp;dq\u003d%22korephilia%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d2FD1UtbwEonxhQeTt4H4Dw\u0026amp;ved\u003d0CDkQ6AEwAQ \u0026lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;Pederasty\u0026lt;/span\u0026gt;]”\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Unlike pedophilia, which defines adult male or female attraction to a prepubescent girl or boy under thirteen, and \u0027\u0027korephilia\u0027\u0027, which denotes adult female attraction to girls, pederasty specifically defines emotional, intimate, and physical adult male attraction to teenage boys\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Bonnie G. Smith (editor), \u0027The Oxford Encyclopedia of Women in World History\u0027 III: \u0027Kaffka–Service Sector\u0027, “[http://books.google.co.uk/books?id\u003dLgPYAAAAMAAJ\u0026amp;q\u003d%22korephilia%22\u0026amp;dq\u003d%22korephilia%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d2FD1UtbwEonxhQeTt4H4Dw\u0026amp;ved\u003d0CD0Q6AEwAg Pederasty]”\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Contemporary pederasty and \u0027\u0027korephilia\u0027\u0027 differ from classical norms in that the younger partner may…take sexual initiative rather than be passive in serving the pleasures of the older partner\", \"priority\":11}]}, \"synonyms\":{}}");

