	add("korhaan", "{\"term\":\"korhaan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several large, terrestrial birds in the bustard family Otididae\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, w:J. M. J. M. Coetzee, \u0027w:Boyhood: Scenes from Provincial Scenes from Provincial Life\u0027, 2011, [http://books.google.com.au/books?id\u003dvOenQzVOTPgC\u0026amp;pg\u003dPA75\u0026amp;dq\u003d%22korhaan%22%7C%22korhaans%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003daIRvUtbdL6bjiwKxvIG4BQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22korhaan%22%7C%22korhaans%22\u0026amp;f\u003dfalse page 75\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"They are hunting the fabled paauw. However, since paauw are sighted only once or twice a year - so rare are they, indeed, that there is a fine of fifty pounds for shooting them, if you are caught — they settle for hunting \u0027\u0027korhaan\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, C. J. Vernon, \u00275: Biogeography, endemism and diversity of animals in the karoo\u0027, William Richard John Dean, Suzanne Milton (editors), \u0027The Karoo: Ecological Patterns and Processes\u0027, [http://books.google.com.au/books?id\u003dQSzjbQf_zNAC\u0026amp;pg\u003dPA70\u0026amp;dq\u003d%22korhaan%22%7C%22korhaans%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003daIRvUtbdL6bjiwKxvIG4BQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22korhaan%22%7C%22korhaans%22\u0026amp;f\u003dfalse page 70\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"If it is assumed that delayed dispersal is the norm amongst \u0027\u0027korhaans\u0027\u0027 then the karoo \u0027\u0027korhaan\u0027\u0027 has a lower fecundity than the other members of the species complex. This suggests that the karoo \u0027sensu lato\u0027 is a less favourable environment for \u0027\u0027korhaans\u0027\u0027 than is either the desert, savannah, or grassland\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Mike Unwin, photograh caption, \u0027Southern African Wildlife\u0027, [http://books.google.com.au/books?id\u003dHKOTgG-olCQC\u0026amp;pg\u003dPA140\u0026amp;dq\u003d%22korhaan%22%7C%22korhaans%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003daIRvUtbdL6bjiwKxvIG4BQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22korhaan%22%7C%22korhaans%22\u0026amp;f\u003dfalse page 140\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Korhaans\u0027\u0027, like this red-crested \u0027\u0027korhaan\u0027\u0027 (\u0027above\u0027, MU), generally rely on their camouflage to avoid danger. But breeding males, like this northern black \u0027\u0027korhaan\u0027\u0027 (\u0027right\u0027, PP) give themselves away with raucous and conspicuous displays\", \"priority\":10}]}, \"synonyms\":{}}");

